// import "react-loader-spinner/dist/loader/css/react-spinner-loader.css"
import ClipLoader from "react-spinners/ClipLoader";

const Loading = ()=>{
   return(
       <div align = "center" >
           <ClipLoader 
               type="Hearts"
               color="rgb(0, 153, 255)"
               height={100}
               width={100}
               timeout={3000} //3 secs
        />
       </div>
   )
}

export default Loading;
